text:
@MinPres Het contact met eigen Volk is hij kwijt!
Waarom help hij de getroffen slachtoffers in eigen land niet, die getroffen zijn door aardbevingen?
Of wacht effe dat komt zeker door de Russen!

@MinPres Als in: Gaat het? Ja hè?
Helpen? Nee hè?
Neem niet te veel hooi op je vork, je hebt het al druk genoeg met je eigen landje naar de verdommenis te helpen.

@MinPres Help eerst de armoede in Nederland maar weg door degenen die hier komen #PARASITEREN en #RELLEN en hun zieke #GELOOF komen opdringen het land uit te helpen.
Daarna kun je over de grens kijken.
Hielpen #ARABIË #AFRIKA hier in de hongerwinter? Nou?
